import React from "react";
import Navbar from './navbar';
import "../styles/header.css";
import appleHeadphones from '../resource/apple-headphones.png';
import brushboxNew from '../resource/brushbox-new.png';
import coffeeCup from '../resource/coffee-cup.png';
import iphoneNew from '../resource/iphone-new.png';
import mbpNew from '../resource/mbp-new.png';
import padNew from '../resource/pad-new.png';
import {headerContentData} from "../actions/headerContent";
import {connect} from "react-redux"

class Header extends React.Component {
componentDidMount() {
    this.props.fetchData("/dsad");
}

    render() {
    return (
        <div className="header" id="header">
            <Navbar/>
            <div className="sliderContent">
                <div className="headerText">
                    <h1>WELCOME TO OSHINE </h1>
                    <h5>A High Quality Multi-Layout Multi Purpose Premium<br/>
                        Wordpress theme with 16 Stunning Demos </h5>
                </div>
                <img className="brushboxNew" src={brushboxNew} alt="brushbox-new"/>
                <img className="appleHeadphones" src={appleHeadphones} alt="apple-headphones"/>
                <img className="coffeeCup" src={coffeeCup} alt="coffee-cup"/>
                <img className="iphoneNew" src={iphoneNew} alt="iphone-new"/>
                <img className="mbpNew" src={mbpNew} alt="mbp-new"/>
                <img className="padNew" src={padNew} alt="pad-new"/>
            </div>
        </div>
    )
}
}
const mapStateToProps=state=>{
    return {
        headerContent:state.headerContent
    };
};
const mapDispatchToProps= dispatch =>{
    return {
        fetchData: url => dispatch(headerContentData(url))
    }
}
export default connect(mapDispatchToProps, mapStateToProps)(Header)
